import React from 'react'
import Notes from './Notes'
import { useEffect } from 'react'

const Home = (props) => {

    useEffect(() => {
        localStorage.removeItem('token')
    }, [])

    return (
        <div>
            <Notes showAlert={props.showAlert}/>
        </div>
    )
}

export default Home
